import React from "react";
import Button from "@mui/material/Button";
import Stack from "@mui/material/Stack";

const Header = () => {
  return (
    <div className='App'>
      <Stack
        direction='row'
        justifyContent='space-between'
        alignItems='baseline'>
        <h3>Destinations</h3>
        <Button variant='contained'>Text</Button>
      </Stack>
    </div>
  );
};

export default Header;
